import Menu from './Menu';
import Footer from './Footer';
import data from '../data/data.json';



const BannerTitleContent = () => {
    return(
        <div className='bannerTitleContent'>
            <span></span>
            <p>DÃ©veloppement</p>
        </div>
    );
}; 

const BannerTitle = () => {
    return (
        <div className='bannerTitle'>
            <BannerTitleContent/>
            <BannerTitleContent/>
            <BannerTitleContent/>
            <BannerTitleContent/>
        </div>
    );
}; 


const Category = () => {
    return(
        <div className='category'>
            <p>Vue.js</p>
        </div>
    ); 
}; 

const ProjectBanner = () => {
    return (
        <div className='project_banner'>
            <div className='titles_page'>
                <BannerTitle/>
                <BannerTitle/>
                <BannerTitle/>
            </div>
            <div>
                <div className='categories'>
                    <Category/>
                    <Category/>
                    <Category/>
                    <Category/>
                </div>

            </div>

        </div>
    ); 
}; 

const ProjectPage = () => {
    return (
        <div>
            <Menu />
            <ProjectBanner />
            <Footer />
        </div>
    );
};

export default ProjectPage;
